import React from 'react'
import './Acceuil.css'

function Acceuil() {
    const [email, setEmail] = useState('');
    const handleEmailChange = (e) => {
        setEmail(e.target.value);
    };
    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('Adresse e-mail:', email);
    };  
  return (
    <div className="background-container">
      <div className='header_Acc'>
            <h1 id='titrePg'>AflemCom</h1>
            <div className='droite_Header'>
                <button id='Btn_Cnx'></button>
            </div>
      </div>
      <div className='Body_Acc'>
        <p className='Pgr_AflamCom'>

        </p>
        <form onSubmit={handleSubmit}>
            <input
              placeholder="Adresse E-mail"
              type="email"
              id="email"
              value={email}
              onChange={handleEmailChange}
              required
            />
            <button id='btnSident' type="submit">S'identifier</button>
        </form>    
      </div>
    </div>
  )
}

export default Acceuil
